-- ----------------------------
-- Table structure for act_node_assignee
-- ----------------------------
DROP TABLE IF EXISTS `act_node_assignee`;
CREATE TABLE `act_node_assignee` (
  `id` varchar(225) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'id',
  `process_definition_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '流程定义id',
  `choose_way` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '选择方式',
  `node_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '流程节点id',
  `node_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '流程节点名称',
  `assignee` varchar(4000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '审批人员',
  `assignee_id` varchar(4000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '审批人员id',
  `business_rule_id` bigint(20) DEFAULT NULL COMMENT '业务规则id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `create_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '创建人',
  `update_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '更新人',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否弹窗选人,0不弹,1弹窗',
  `multiple` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否会签,0非会签,1会签',
  `multiple_column` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '会签保存人员KEY值',
  `is_back` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可退回,0不可退回,1可退回',
  `is_delegate` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可委托,0不可委托,1可委托',
  `is_transmit` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可转办,0不可转办,1可转办',
  `is_copy` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可抄送,0不可抄送,1可抄送',
  `add_multi_instance` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可加签,0不可加签,1可加签',
  `delete_multi_instance` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可加签,0不可减签,1可减签',
  `task_listener` varchar(4000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '任务监听',
  `auto_complete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '自动审批,0不自动办理,1自动办理,当前节点自动办理,下一节点不可弹窗选人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='流程定义设置';

