INSERT INTO `jimu_report_db` VALUES ('698071316680126464', '698070126881910784', 'admin', 'admin', '2022-06-22 21:03:17', '2022-06-22 21:03:17', 'sys_log_info', '系统日志', '0', null, 'select s.oper_id,s.title  as title,d.dict_label as dict_label,s.method as method,s.request_method ,s.oper_name ,s.dept_name,s.oper_url,s.oper_location,s.json_result ,s.error_msg ,DATE_FORMAT(s.oper_time,\'%Y-%m-%d\') as oper_time,(case s.`status` when 0 then \'正常\' ELSE \'异常\' end) as status\nfrom sys_oper_log s\nleft join sys_dict_data  d on s.operator_type=d.dict_value and d.dict_type=\'sys_oper_type\'', null, null, null, null, null, null, null, '1', '1', '698070692328615936', 'MYSQL5.7');
INSERT INTO `jimu_report_db` VALUES ('701379498455109632', '701376236058349568', 'admin', null, '2022-06-27 20:38:34', '2022-06-27 20:38:33', 'leave', '请假表单', '0', null, 'select a.id,a.username,a.duration,a.principal,a.contact_phone,a.leave_type,a.title,a.leave_reason,a.start_date,a.end_date from bs_leave a where a.id=\'${id}\'', null, null, null, null, null, null, null, '1', '0', '', 'MYSQL');

